import React from 'react';
import {Routes, Route} from 'react-router-dom';
import Header from "../components/Header";
import Footer from "../components/Footer";
import Sidebar from '../components/Sidebar';
import { DEALS_ROUTE, ORG_ROUTE, USERS_ROUTE, PRODUCTS_ROUTE, ANALITICS_ROUTE, SETTINGS_ROUTE } from "../utils/consts";

export default function Layout() {
  return (
    <div className='container'>
      <div className='workspace'>
        <Sidebar />
        <div className='main-content'>
          <Header />
          <Routes>
            <Route path={DEALS_ROUTE} element={<Deals />} />
            <Route path={ORG_ROUTE} element={<Org />} />
            <Route path={USERS_ROUTE} element={<Deals />} />
            <Route path={PRODUCTS_ROUTE} element={<Deals />} />
            <Route path={ANALITICS_ROUTE} element={<Deals />} />
            <Route path={SETTINGS_ROUTE} element={<Deals />} />
          </Routes>
        </div>
      </div>
      <Footer />
    </div>
  )
}
